"use strict";
var express = require("express");
var router = express.Router();
var config = require('../config');
var db = require('../database/db.service');
var authentication = require('../authentication');
router.post('/termination', function (req, res) {
    //req.isAuthenticated()
    if (true) {
        db.getConnection(function (err, connection) {
            if (err) {
                console.error('error', err);
                connection.release();
                return res.status(500).send(err);
            }
            else {
                connection.query('SELECT * FROM ' + config.db_tables.RENTAL_LEASEDETAILS + ' WHERE username = ? AND type= ? ', [req.body.id, req.body.type], function (err, rows) {
                    if (err) {
                        console.error('error', err);
                        connection.release();
                        return res.status(500).send(err);
                    }
                    return res.status(200).send(rows);
                    //res.status(200).json();
                });
            }
        });
    }
});
module.exports = router;

